import React, {useState} from "react"
import AddHikeForm from "./AddHikeForm"

export default function Hiking({props}) {
    const {hikeName, distance, state, elevationGain, difficulty, notes, _id} = props
    const [editHikingToggle, setEditHikingToggle] =useState(false)
   // buttons need to be in hikeItems line 19. Copy and paste buttons from below and move up here.
    console.log(Object.keys(props), "props - hiking")
        const hikeItems = props.hikes?.length ? props.hikes.map(hike => {
        return(
            <div className="hikes-container">
                <h1>Name: {hike.hikeName}</h1>
                <h2>Distance: {hike.distance}</h2>
                <h3>State: {hike.state} </h3>
                <h3>Zipcode: {hike.zipcode}</h3>                
                <h4>Elevation Gain: {hike.elevationGain}</h4>
                <h4>Difficulty: {hike.difficulty}</h4>
                <p className="notes">Notes: {hike.notes}</p>
                <button
                    className="delete-button"
                    onClick={(props.deleteHike)}>
                        Delete
                    </button>
                <button
                    className="edit-button"
                    onClick>Edit</button>
            </div>
        )
    }) 
    :
    []

    return(
        <div className="hiking">

            <h4>Filter By Difficulty:</h4>
            <select onChange ={props.handleHikeFilter} className="filter-form">
                <option value="reset">All Hikes</option>
                <option value="1">1</option>
                <option value="1">2</option>
                <option value="1">3</option>
                <option value="1">4</option>
                <option value="1">5</option>
                <option value="1">6</option>
                <option value="1">7</option>
                <option value="1">8</option>
                <option value="1">9</option>
                <option value="1">10</option>
            </select>

            {/* { Hiking.map(hiking =>
                <Hiking 
                {...hiking}
                key={hiking.hikeName}
                deleteHike={deleteHike}
                editHike={editHike}/>)
                } */}


            { !editHikingToggle ?
            <>
            {/* <h1>Hike Name: {hikeName}</h1>
            <h2>State: {state}</h2>
            <h3>Distance: {distance}</h3>
            <h3>Elevation Gain: {elevationGain}</h3>
            <h3>Difficulty: {difficulty}</h3>
            <h3>Notes: {notes}</h3> */}
            <button     
                className="delete-button"
                onClick={() => props.deleteHike}>
                    Delete
                </button>
                <button
                    className="edit-button"
                    onClick={() => setEditHikingToggle(prevToggle => !prevToggle)}>
                    Edit
                </button>
            </> 
            :
            <>
                <AddHikeForm
                    // key={hikeName._id}
                    hikeName={hikeName}
                    distance={distance}
                    state={state}
                    elevationGain={elevationGain}
                    difficulty={difficulty}
                    notes={notes}
                    _id={_id}
                    btnText="Submit Edit"
                    submit={props.editHike}
                />
                <button 
                onClick={() => setEditHikingToggle(prevToggle => !prevToggle)}>
                    Close
                </button>
            </>   
        }
        {hikeItems}
        </div>
    )
}
